import React, { Component } from 'react';

import './Experience.css';
import efluid from './assets/efluid.png';

class Experience extends Component {
  render() {
    return (
      <div id="experience">
        <h1 className="type-writer title">Mes expériences professionnelles</h1>
        <div className="content">
          <ul>
            <li>Stage de 10 semaines de fin de formation DUT chez efluid <img src={efluid} height="352" width="470" alt="eFluid"/></li>
            <ul>
              <li>sujet : mise en place d'un système de log dans le moteur d'estimation afin de tracer l'exécution</li>
              <li>Etude comparative afin de choisir le système de log le plus adapté</li>
              <li>Ecriture de test unitaires en java pour prendre connaissance des points importants à logger</li>
            </ul>
            <li>Mission d’intérim d'un durée de 2 mois chez efluid suite au stage</li>
            <ul>
              <li>sujet : approfondissement du sujet du stage</li>
              <li>Réalisation de plusieurs études ayant pour but un refactoring du code</li>
            </ul>
            <li>Aide agricole saisonnière (sur 4 ans)</li>
            <li>Travail saisonnier dans une fromagerie (sur 2 ans)</li>
          </ul>
        </div>
      </div>
    );
  }
}

export default Experience;
